const DivText = styled.div`
  background-color: #f1f1f1;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  width: 100%;
  padding: 5vh 0;
`;
const DivImage = styled.div`
  padding: 5vh 0;
  background-image: url(${props => props.image});
